/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 *
 * https://leetcode.com/problems/find-the-difference/
 */
var findTheDifference = function(s, t) {
  let sMap = new Map();
  for (let char of s) {
    if (sMap.get(char) === undefined) {
      sMap.set(char, 1);
    } else {
      sMap.set(char, sMap.get(char) + 1);
    }
  }
  for (let char of t) {
    if (sMap.get(char) === undefined || sMap.get(char) <= 0) return char;
    sMap.set(char, sMap.get(char) - 1);
  }
};

// console.log(findTheDifference('abcd', 'abcde'));
// console.log(findTheDifference('ab', 'aab'));

console.log(
  findTheDifference(
    '',
    ''
  )
);
